				'getTracking'            => $xml,
				'convertResponseToArray' => XML2Array::createArray( $xml ),
			)
		);

		$container = $this->makeEmpty(
			ContainerInterface::class,
			array(
				'get' => $tracker,
			)
		);

		$sut = new USPS_Tracker( $container, $logger );

		$id  = '9400136123333319134311';
		$id2 = '9123136112333311234311';

		$ids = array( $id, $id2 );

		$result = $sut->query_multiple_tracking_numbers( $ids );

		$this->assertArrayHasKey( $id, $result );
		$this->assertArrayHasKey( $id2, $result );

		$this->assertInstanceOf( USPS_Tracking_Details::class, $result[ $id ] );
