	public function test_update_not_yet_available_single() {
		$logger = new ColorLogger();

		$xml_reponse = <<<'EOD'
<?xml version="1.0" encoding="UTF-8"?>
<TrackResponse><TrackInfo ID="9123123123231234567890"><Error><Number>-2147219283</Number><Description>A status update is not yet available on your package. It will be available when the shipper provides an update or the package is delivered to USPS. Check back soon. Sign up for Informed Delivery&lt;SUP>&amp;reg;&lt;/SUP> to receive notifications for packages addressed to you.</Description><HelpFile/><HelpContext/></Error></TrackInfo></TrackResponse>
EOD;

		$tracker = $this->makeEmpty(
			TrackConfirm::class,
			array(
				'getTracking'            => $xml_reponse,
				'convertResponseToArray' => XML2Array::createArray( $xml_reponse ),
			)
		);

		$container = $this->makeEmpty(
			ContainerInterface::class,
			array(
				'get' => $tracker,
			)
		);

		$sut = new USPS_Tracker( $container, $logger );

		$result = $sut->query_single_tracking_number( '9123123123231234567890' );

		$b = $result;
	}

